import React from 'react';
import { Modal, Form, Input, InputNumber } from "antd";

class ModelCheckout extends React.Component {
    state = { visible: false };
    handleOk = (e) => {
        console.log(e);
        this.setState({
          visible: false
        });
    };

    handleCancel = (e) => {
        console.log(e);
        this.setState({
            visible: false
        });
    };

    render() {
        return (
            <Modal
          width={650}
          title="Please Type Information"
          visible={this.state.visible}
          onOk={this.handleOk}
          onCancel={this.handleCancel}
        >
          <Form
            labelCol={{
              span: 4
            }}
            wrapperCol={{
              span: 14
            }}
            layout="horizontal"
          >
            <Form.Item
              label="Name"
              rules={[
                {
                  required: true,
                  message: "Please input your Name !"
                }
              ]}
            >
              <Input />
            </Form.Item>
            <Form.Item
              label="Address"
              rules={[
                {
                  required: true,
                  message: "Please input your Adrress !"
                }
              ]}
            >
              <Input />
            </Form.Item>
            <Form.Item
              label="Telephone"
              rules={[
                {
                  required: true,
                  message: "Please input your Phone !"
                }
              ]}
            >
              <InputNumber style={{ width: "100%" }} size="large" />
            </Form.Item>
          </Form>
        </Modal>
        )
    }
}
export default ModelCheckout;
